                        "title": "A New Threat",
                        "description": "**Previous Quest:** Mechanical Menace (automatically started after reaching level 15, and completed when meeting [Ada](https:\/\/fallout4map.com?locationIds=351094))\n\n_Ada said she saw the Mechanist's robots at the [General Atomics Factory](https:\/\/fallout4map.com?locationIds=71901). I may be able to find something there to help us discover where the Mechanist is._\n\n**Reward:**\n- 350 XP\n\n**Next Quest:** [Headhunting](https:\/\/fallout4map.com?locationIds=442288)",
