                        "title": "Headhunting",
                        "description": "**Previous Quest:** [A New Threat](https:\/\/fallout4map.com?locationIds=442284) (Completed when modifying Ada at any settlement's robot workbench)\n\n_Ada has detected a second Robobrain. I should head out to the location and retrieve its Radar Beacon._\n\n**Reward:**\n- 470 XP\n- Jezebel as a settler\n\n**Next Quest:** [Restoring Order](https:\/\/fallout4map.com?locationIds=442298)",
