                        "title": "Restoring Order",
                        "description": "**Previous Quest:** [Headhunting](https:\/\/fallout4map.com?locationIds=442288) (Completed after making Jezebel a body)\n\n_I discovered the Mechanist's lair has a hidden entrance in the old [RobCo Sales and Service](https:\/\/fallout4map.com?locationIds=87934) building. I should speak to Ada about my next move._\n\n**Reward:**\n- 400 DLC\n- [Mechanist's Lair Workbench](https:\/\/fallout4map.com?locationIds=442301)\n- [Mechanist's Armor & Mechanist's Helmet](https:\/\/fallout4map.com?locationIds=442304)\n- [Protectron's Gaze](https:\/\/fallout4map.com?locationIds=71810) (if the Mechanist is killed, or your Pickpocket skills are high enough)\n- All modifications unlocked at robot workbenches",
