                        "map_id": 200,
                        "region_id": null,
                        "category_id": 10892,
                        "title": "Fire Support",
                        "description": "**START OF B.O.S. QUESTLINE**\n\n**Quest Giver:** Military Frequency AF95\n\n_A radio broadcast has led me to a group of soldiers outside of Cambridge Police Station. They appear to be under attack by ferals, and from the look of things, they could really use my help._\n\n**Rewards:**\n- 300 XP\n- Brotherhood of Steel Flag (Settlement Crafting Recipe)\n\n**Next Quest:** [Call to Arms](https:\/\/fallout4map.com?locationIds=350479)",
