                        "description": "**Required:** Gain [Cait](https:\/\/fallout4map.com?locationIds=350433)'s approval\n\n_Cait has confided in me that her dependence on Psycho is taking its toll on her health. I need to bring her to Vault 95 to cure her addiction before it's too late._\n\n**Rewards:**\n- 200 XP\n- Addiction-free Cait\n\n_Note: After completing this quest, Cait's approval of chem\/alcohol usage is flipped! Also, Cait will no longer use chems placed in her inventory._",
                        "latitude": "0.51732664174877",
