                        "title": "Emergent Behavior",
                        "description": "**Required:**\n- Complete [Dangerous Minds](https:\/\/fallout4map.com?locationIds=354342) (Main Quest)\n- Gain [Curie](https:\/\/fallout4map.com?locationIds=350475)'s approval\n\n_Curie wants to become human, or as close to it as she can better pursue her studies. We need to find an expert: a brain surgeon, an AI programmer, or similar._\n\n**Rewards:**\n- 300 XP\n- Curie Appearance",
                        "latitude": "0.72674650214228",
