                        "title": "Long Road Ahead",
                        "description": "**Required:** Gain [MacCready](https:\/\/fallout4map.com?locationIds=350823)'s approval\n\n_MacCready has asked me to travel to the Mass Pike Interchange to hunt down and kill Winlock and Barnes, the two Gunners that were threatening him in Goodneighbor._\n\n**Reward:** 250 XP",
