                        "title": "Long Time Coming",
                        "description": "**Required:** Gain [Nick Valentine](https:\/\/fallout4map.com?locationIds=351089)'s approval\n\n_Nick asked for my help in recovering ten holotapes belonging to Eddie Winter. He thinks the Commonwealth's police evidence terminals should be able to point me towards the tapes._\n\n**Rewards:**\n- 450 XP\n- [Eddie's Peace](https:\/\/fallout4map.com?locationIds=71792) (Unique Gun)",
