                        "title": "Far From Home",
                        "description": "**START OF FAR HARBOR (DLC) QUESTLINE**\n\n**Quest Giver:** Listen to Valentine Detective Agency Radio or discover [Nakano Residence](https:\/\/fallout4map.com?locationIds=72719)\n\n_Kasumi Nakano has run away from home. I need to investigate to find where she went and why._\n\n**Rewards:**\n- XP\n- Access to [Far Harbor](https:\/\/fallout4map.com\/far-harbor) (opens new tab)\n\n**Next:** [Walk in the Park](https:\/\/fallout4map.com\/far-harbor?locationIds=403117)",
