                        "title": "Taking Independence",
                        "description": "**Previous Quest:** [The First Step](https:\/\/fallout4map.com?locationIds=350647)\n\nRequires at least four settlements be recruited to the Minutemen cause via the radiant quests [Taking Point](https:\/\/fallout4map.com?locationIds=350689) or the recruitment side quests [The First Step](https:\/\/fallout4map.com?locationIds=350647), [Out of the Fire](https:\/\/fallout4map.com?locationIds=350754), [Returning the Favor](https:\/\/fallout4map.com?locationIds=350759), and [Troubled Waters](https:\/\/fallout4map.com?locationIds=350767).\n\n**Quest Giver:** Preston Garvey\n\n_Preston Garvey thinks it's time for the Minutemen to retake \"The Castle\", an old fort that used to be their main base of operations._\n\n**Rewards:**\n- 350 XP\n- Settlement: [The Castle](https:\/\/fallout4map.com?locationIds=72055)\n\n**Next Quest:** [Old Guns](https:\/\/fallout4map.com?locationIds=350711)",
