                        "category_id": 10895,
                        "title": "With Our Powers Combined",
                        "description": "**WARNING: Completing this quest is a point of no return for faction allegiances!**\n\n**Previous Quest:** [The Nuclear Option (Minutemen)](https:\/\/fallout4map.com?locationIds=350738)\n\n**Quest Giver:** Preston Garvey\n\n_It's time for the Minutemen to remove the Brotherhood of Steel as a threat to the Commonwealth._\n\nNote: If you'd like the Minutemen to be the **last faction standing**, start this quest **after** siding with the Brotherhood of Steel to neutralize the Railroad and Institute. Complete [The Nuclear Option (Brotherhood of Steel)](https:\/\/fallout4map.com?locationIds=350618), then return to Preston Garvey to begin this quest.\n\n**Reward:** 350 XP",
