                        "title": "Defend the Castle",
                        "description": "**Previous Quest:** [Inside Job](https:\/\/fallout4map.com?locationIds=350735)\n\nRequires at least eight settlements be recruited to the Minutemen cause via the radiant quests [Taking Point](https:\/\/fallout4map.com?locationIds=350689) or the recruitment side quests [The First Step](https:\/\/fallout4map.com?locationIds=350647), [Out of the Fire](https:\/\/fallout4map.com?locationIds=350754), [Returning the Favor](https:\/\/fallout4map.com?locationIds=350759), and [Troubled Waters](https:\/\/fallout4map.com?locationIds=350767).\n\nIf you do not have enough settlements, then [Form Ranks](https:\/\/fallout4map.com?locationIds=350736) will start instead.\n\n**Quest Giver:** Preston Garvey\n\n_The Institute is preparing to attack the Castle to try to crush the Minutemen before we can build up enough strength to strike them. I need to help defend the Castle before it's too late._\n\n**Reward:** 300 XP\n\n**Next Quest:** [The Nuclear Option (Minutemen)](https:\/\/fallout4map.com?locationIds=350738)",
                        "latitude": "0.99428788888206",
                        "longitude": "-0.88192105293311",
