                        "description": "**Faction:** Brotherhood of Steel\n\n**Available After:** [Semper Invincta](https:\/\/fallout4map.com?locationIds=350509)\n\n**Quest Giver:** Knight Rhys\n\n_Knight Rhys has given me an assignment to clear a location of what he calls \"abominations.\" I need to find the location and eliminate any synths, Ferals, Super Mutants, and Atom worshipping cultists that I can find._\n\n**Rewards:**\n- 200 XP\n- Approx. 100 Caps",
