                        "category_id": 10894,
                        "title": "Quartermastery",
                        "description": "**Faction:** Brotherhood of Steel\n\n**Available After:** [Semper Invincta](https:\/\/fallout4map.com?locationIds=350509)\n\n**Quest Giver:** Scribe Hayden\n\n_Scribe Haylen has given me a mission to recover a piece of technology for her at a given location. I need to go there, find the artifact, and bring it back to her in one piece._\n\n**Rewards:**\n- 200 XP\n- Approx. 100 Caps",
