                        "id": 350689,
                        "map_id": 200,
                        "region_id": null,
                        "category_id": 10894,
                        "title": "Taking Point",
                        "description": "**Faction:** Minutemen\n\n**Available After:** [The First Step](https:\/\/fallout4map.com?locationIds=350647)\n\n**Quest Giver:** Preston Garvey or Settler\n\nThis is a catch-all map marker for all radiant quests related to the Minutemen recruiting new settlements or aiding existing settlers. All of these quests will have formulaic titles. For example, \"(Resource) for (Location)\" could appear as \"Power for Ten Pines\" in-game.\n- (Resource) for (Location)\n- Clearing the Way for (Location)\n- Defend (Location)\n- Suspected Synth at (Location)\n- Taking Point: (Location)\n- etc. etc.\n\n**Tip:** There is a no-mod method to stopping these quests. Complete a radiant quests up to the final step \"Talk to Preston Garvey\". Then, as you're talking to Preston, walk away mid-dialogue before he mentions another settlement needs help. The timing can be tricky, but it works. \n\n**Rewards:**\n- Approx. 50-200 XP\n- Approx. 100 Caps",
