                        "description": "**Faction:** Brotherhood of Steel\n\n**Available After:** [Shadow of Steel](https:\/\/fallout4map.com?locationIds=350546)\n\n**Quest Giver:** Lancer Captain Kells\n\n_I spoke to Lancer Captain Kells and agreed to train one of the Brotherhood Squires by allowing him to accompany me on a mission. I was told to meet the Squire in the airport where he'll give me further details on the mission location._\n\n**Rewards:**\n- 300 XP\n- Approx. 100 Caps",
