                        "title": "A Clean Equation",
                        "description": "**Faction:** The Railroad\n\n**Available After:** [The Nuclear Option (Railroad)](https:\/\/fallout4map.com?locationIds=350817)\n\n**Quest Giver:** P.A.M.\n\n_Even with the Prydwen destroyed, Brotherhood stragglers are a threat to the Railroad. PAM has spotted a surviving patrol. It's my job to deal with them._\n\n**Rewards:**\n- 75 XP\n- 130 Caps",
