                        "category_id": 10894,
                        "title": "Randolph Safehouse",
                        "description": "**Faction:** Railroad\n\n**Available After:** May only begin if you have no other Railroad quests active\n\n**Quest Giver:** Drummer Boy\n\n_Randolph Safehouse has been dark since Switchboard fell. Drummer Boy says the safehouse has left a message at a dead drop. I've been tapped to intercept it._\n\n**Rewards:**\n- XP\n- Caps\n- Institute Killer Weave armor mod (after completing the quest 6 times)",
