                        "category_id": 10894,
                        "title": "To the Mattressess",
                        "description": "**Faction:** Railroad\n\n**Available After:** Complete [The Nuclear Option (Railroad)](https:\/\/fallout4map.com?locationIds=350817)\n\n**Quest Giver:** Desdemona\n\n_The Synth-hating L&L Gang is the greatest single threat remaining to the Railroad with the Institute out of the picture. Desdemona has a lead on them. And my job is dealing with it._\n\n**Rewards:**\n- XP\n- Caps",
