                        "region_id": null,
                        "category_id": 10893,
                        "title": "Road to Freedom",
                        "description": "**START OF RAILROAD QUESTLINE**\n\n**Quest Giver:**\n- Listen to \"Join the Railroad\" Holotape\n- Follow the Freedom Trail (Miscellaneous Objective)\n\n_If I want to fight the Institute, I've been told I should find the Railroad. The only clue I have is: \"Follow the Freedom Trail.\" The tourist trail starts at Boston Common._\n\n**Reward:** 300 XP\n\n**Next Quest:** [Tradecraft](https:\/\/fallout4map.com?locationIds=350802)",
