                        "region_id": null,
                        "category_id": 10893,
                        "title": "Tradecraft",
                        "description": "**Previous Quest:** [Road to Freedom](https:\/\/fallout4map.com?locationIds=350798)\n\n**Quest Giver:** Desdemona\n\n_Deacon wants to help me join the Railroad. In order to join, I have to help him on a mission. He said he'd meet me by the old freeway outside Lexington._\n\n**Rewards:**\n- 300 XP\n- [Deliverer](https:\/\/fallout4map.com?locationIds=71793) (Unique Gun)\n- Railroad Rank: Member\n- Companion: [Deacon](https:\/\/fallout4map.com?locationIds=350803)\n\n**Next Quest:** [Underground Undercover](https:\/\/fallout4map.com?locationIds=350810)",
                        "latitude": "0.76310345390202",
