                        "region_id": null,
                        "category_id": 10893,
                        "title": "Precipice of War",
                        "description": "**Previous Quest:** [Underground Undercover](https:\/\/fallout4map.com?locationIds=350810)\n\n**Quest Giver:** Z1-14\n\n_There's only one way out of the HQ\u2014straight through the catacombs and everything the Brotherhood brought to wipe us out. I'm the Railroad's only hope._\n\n**Reward:** 500 XP\n\n**Next Quest:** [Rockets' Red Glare](https:\/\/fallout4map.com?locationIds=350815)",
                        "latitude": "0.76310345390202",
