                        "map_id": 200,
                        "region_id": null,
                        "category_id": 10893,
                        "title": "Rockets' Red Glare",
                        "description": "**Previous Quest:** [Precipice of War](https:\/\/fallout4map.com?locationIds=350811)\n\n**Quest Giver:** Desdemona\n\n_We actually made it aboard the Prydwen. Now it's my job to place explosive charges on the Prydwen's gas bags. After that, I need to get back to our stolen vertibird and fly to a safe distance so we can remotely detonate it._\n\n**Reward:** 500 XP\n\n**Next Quest:** [The Nuclear Option (Railroad)](https:\/\/fallout4map.com?locationIds=350817)",
