                        "region_id": null,
                        "category_id": 10896,
                        "title": "Hole in the Wall",
                        "description": "**Required:** After completing [Vault 81](https:\/\/fallout4map.com?locationIds=350473), either leave the Vault for 24 hours or complete [Here Kitty, Kitty](https:\/\/fallout4map.com?locationIds=355593)\n\n**Quest Giver:** Dr. Priscilla Penske (located in Clinic)\n\n_Austin was bitten by a diseased mole rat. I'm going to the newly discovered secret part of the vault to look for a cure._\n\n**Rewards:**\n- 250 XP\n- [Short Syringer Rifle](https:\/\/fallout4map.com?locationIds=71784)\n- [Curie (Companion)](https:\/\/fallout4map.com?locationIds=350475)\n- Vault 81 Room",
