                        "category_id": 10896,
                        "title": "Vault 81",
                        "description": "**Quest Giver:** Overseer McNamara after attempting to get inside [Vault 81](https:\/\/fallout4map.com?locationIds=72065)\n\n_I discovered a potentially functional Vault called Vault 81. Their Overseer offered a tradeoff: I can enter the Vault if I bring them Fusion Cores._\n\n**Note:** You can skip the fusion core trade by pointing out that you're a fellow vault dweller and  passing a speech check.\n\n**Rewards:**\n- 75 XP\n- Vault 81 Access",
