                        "title": "Dependency",
                        "description": "**Required:** [Hole in the Wall](https:\/\/fallout4map.com?locationIds=350472)\n\n**Quest Giver:** Tina De Luca\n\n_Tina asked me to try to get Bobby off the Jet. After what happened with Austin, he needs to quit before someone else gets hurt. She said Rachel has treatment drugs that can help him._\n\n**Rewards:**\n- 75 XP",
                        "latitude": "0.69826900920076",
