                        "description": "**Required:** [Show No Mercy](https:\/\/fallout4map.com?locationIds=350553) (Brotherhood of Steel)\n\n**Quest Giver:** Lancer Captain Kells\n\n_Captain Kells ordered me to investigate some missing supplies at the airport. I should report to Knight Sergeant Gavil for more information._\n\n**Rewards:** Depends on quest outcome. If you convince the traitor to turn themselves in, you'll receive Exemplar's T-60C (Unique Power Armor).",
