                        "category_id": 10896,
                        "title": "A Loose End",
                        "description": "**Required:**\n- Virgil is still alive\n- Complete [Liberty Reprimed](https:\/\/fallout4map.com?locationIds=350589) (Brotherhood of Steel)\n\n**Quest Giver:** Lancer Captain Kells\n\n_Captain Kells ordered me to kill Virgil, but Virgil says he poses no threat to the Brotherhood. Should I complete my original mission or protect Virgil and lie to Captain Kells?_\n\n**Rewards:**\n- 300 XP\n- Visionary's T-60C Helmet (Power Armor Part)",
