                        "title": "Order Up",
                        "description": "**Quest Giver:** [Wolfgang](https:\/\/fallout4map.com?locationIds=350625) or [Trudy](https:\/\/fallout4map.com?locationIds=350624); Walk near diner\n\n_Wolfgang over at the Drumlin Diner says Trudy owes him money she won't pay. He's offering me a reward if I resolve their disagreement._\n\nWhoever remains at the end of the quest becomes a trader at Drumlin Diner. Wolfgang sells chems; Trudy is a general store.\n\n**Rewards:**\n- XP\n- Caps",
