                        "description": "**Required:** Only available if you failed during [Underground Undercover](https:\/\/fallout4map.com?locationIds=350810) and became an enemy of the Institute\n\n**Quest Giver:** Desdemona\n\n_My cover with The Institute has been blown. I need to report back to Desdemona and see how we can proceed._\n\n**Reward:** 75 XP",
