                        "description": "**Required:** Complete [Boston After Dark](https:\/\/fallout4map.com?locationIds=354348)\n\n**Quest Giver:** Doctor Carrington\n\n_Since the fall of Switchboard, the Railroad's been picking up the pieces. Carrington is sending me to check the status of Augusta Safehouse. The details will be at another dead drop._\n\n**Rewards:**\n- 300 XP\n- 150 Caps",
