                        "description": "**Quest Giver:** Greeter Robot\n\n_The General Atomics Galleria is a one-stop shopping destination to showcase the technological developments of General Atomics. This Galleria location is under strict Mr. Gutsy control until it receives orders to reopen._\n\nNote: You will need the [General Atomics ID Card](https:\/\/fallout4map.com?locationIds=401375) from General Atomics Factory to successfully impersonate the General Atomics Director. When the park reopens, items can be taken without stealing and robot personalities are reset.\n\n**Rewards:**\n- Gold Watch\n- 15 x Pre-War Money\n- General Atomics Galleria Reopens",
