                        "description": "**Quest Giver:** [Rufus Rubins](https:\/\/fallout4map.com?locationIds=443812) in the Hotel Rexford, or Drinkin' Buddy in [The Shamrock Taphouse](https:\/\/fallout4map.com?locationIds=71834).\n\n_Rufus Rubins wants to replace the usual barman's swill with something better. Fortunately, Shamrock Taphouse is home to a microbrewing protectron called Drinkin' Buddy. Bring the machine to Rufus to install a new barkeeper at Hotel Rexford._\n\n**Rewards:**\n- 200 XP\n- 200-400 Caps",
