                        "description": "**Quest Giver:** N\/A - Starts inside [Saugus Ironworks](https:\/\/fallout4map.com?locationIds=71885) after you kill a Forged Keeper enemy.\n\n_While investigating the Saugus Ironworks I encountered a gang of raiders called the Forged. Apparently they've set up a trial to find someone worthy of a powerful weapon. I found a note on one of the Forged that may offer a clue on how to retrieve it._\n\n**Rewards:**\n- [Ghoul Slayer's Heavy Incinerator](https:\/\/fallout4map.com?locationIds=508925)",
