                        "description": "**Quest Giver:** N\/A - Begins when approaching [Suggs](https:\/\/fallout4map.com?locationIds=440647).\n\n_In the run-up to the war, the militaries for both the United States and the Chinese developed several powerful infantry weapons, including grenade launchers. It's possible some of those weapons survived today. I should visit a local supplier and see what I can find._\n\n**Rewards:**\n- 200 XP\n- [Piggy Bank Fat Man](https:\/\/fallout4map.com?locationIds=442015)\n- [Flakker](https:\/\/fallout4map.com?locationIds=442021) (if Suggs is killed)\n- [Penetrating Chinese Grenade Launcher Rifle](https:\/\/fallout4map.com?locationIds=442019) (if Suggs is saved)\n- Crafting recipe for Piggy Bank Launcher Bombs\n- Crafting recipe for Piggy Bank Mines",
