                        "description": "**Quest Giver:** Given by Edward Deegan who can appear at [Bunker Hill](https:\/\/fallout4map.com?locationIds=72049), [Diamond City](https:\/\/fallout4map.com?locationIds=193929)'s Dugout Inn, or [Goodneighbor](https:\/\/fallout4map.com?locationIds=72063)'s Third Rail. May also be started by visiting [Cabot House](https:\/\/fallout4map.com?locationIds=71825) and succeeding a skill check.\n\n_I was offered a job from a ghoul named Edward Deegan. If I'm interested, I need to travel to [Cabot House](https:\/\/fallout4map.com?locationIds=71825) in downtown Boston and talk to someone named Jack Cabot._\n\n**Rewards:**\n- XP\n- Caps",
