                        "title": "Painting the Town",
                        "description": "**Quest Giver:** Abbot, found painting the wall at the northern edge of [Diamond City](https:\/\/fallout4map.com?locationIds=193929)\n\n_Abbot in Diamond City wants me to find paint for the city's Wall. There's a place call [Hardware Town](https:\/\/fallout4map.com?locationIds=72016) where I can start looking._\n\n**Rewards:**\n- 150 XP\n- 100 caps (if you paint the wall blue or yellow)\n- 200 caps (if you paint the wall green)\n\n*And if you succeed a few speech checks at the start of the quest...*\n- 125 caps (ask for money & paint the wall blue or yellow)\n- 150 caps (ask for more money & paint the wall blue or yellow)\n- 200 caps (ask for even more money & paint the wall blue or yellow)\n- 225 caps (ask for money & paint the wall green)\n- 250 caps (ask for more money & paint the wall green)\n- 300 caps (ask for even more money & paint the wall green)",
