                        "description": "**Required:** Own and install the Sentinel Control System Companion creation.\n\n**Quest Giver:** Begins when picking up the [Sentinel System Log](https:\/\/fallout4map.com?locationIds=511195)\n\n_I've discovered a system log on one of the Sentinel Power Armors. It seems like a Brotherhood soldier named Dawson reprogrammed the Sentinels to attack his unit. According to the log, he fled to a nearby propane station. I should check it out._\n\n**Rewards:**\n- Sentinel Control System Companion",
